import './App.css';
import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import { Login } from './component/login';
import Home from './component/home';


function App(e) {
  if(true){
    console.log(e);
      return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>}/>
      <Route path='home' element={<Home/>}/>
    </Routes>
    </BrowserRouter>
  );
  }else{
    return (
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Login/>}/>
      </Routes>
      </BrowserRouter>
    );
  }

}

export default App;
